function plusSlides(n){showSlides(slideIndex+=n)}function currentSlide(n){showSlides(slideIndex=n)}function showSlides(n){var t,i=document.getElementsByClassName("dot");for(n>slides.length&&(slideIndex=1),n<1&&(slideIndex=slides.length),t=0;t<slides.length;t++)slides[t].style.display="none";for(t=0;t<i.length;t++)i[t].className=i[t].className.replace(" active","");slides[slideIndex-1].style.display="block";i[slideIndex-1].className+=" active"}var slideIndex=1;const dotLinks=document.querySelectorAll(".dot"),prevLinks=document.querySelectorAll(".prev"),nextLinks=document.querySelectorAll(".next");if(dotLinks.length>0)for(let n=0;n<dotLinks.length;n++){const t=dotLinks[n];t.addEventListener("click",function(){const n=this.id.replace("picture","");currentSlide(n)})}if(nextLinks.length>0)for(let n=0;n<nextLinks.length;n++){const t=nextLinks[n];t.addEventListener("click",function(){plusSlides(1)})}if(prevLinks.length>0)for(let n=0;n<prevLinks.length;n++){const t=prevLinks[n];t.addEventListener("click",function(){plusSlides(-1)})}const slides=document.getElementsByClassName("mySlides");const surveyList=document.querySelector("#survey-list");$("input[name=isActive]").change(function(){$.ajax({type:"GET",url:"/Survey/GetSurveyListPartial",data:{isActive:$("input[name=isActive]:checked").val(),stringSearch:$("#search").val()},success:function(n){surveyList.innerHTML=n}})});$("#search").bind("input",function(){$.ajax({type:"GET",url:"/Survey/GetSurveyListPartial",data:{isActive:$("input[name=isActive]:checked").val(),stringSearch:$("#search").val()},success:function(n){console.log(n);surveyList.innerHTML=n}})});